package WeekOne;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.Map;

public class validAnagram {
    public static void main(String[] args) {
        //   System.out.println(('a'=='n'));
        isAnagram("", "");
        HashMap<Character, Integer> string1 = new HashMap<Character, Integer>();

    }

    public static boolean isAnagram(String s, String t) {

        if(s.length()!=t.length()){
            return false;
        }
        HashMap<Character,Integer> string1= new HashMap<Character,Integer>();
        HashMap<Character,Integer> string2= new HashMap<Character,Integer>();
        for(int i=0;i<s.length();i++){

            if(string1.containsKey(s.charAt(i))){
                string1.put(s.charAt(i),string1.get(s.charAt(i))+1);

            }else{
                string1.put(s.charAt(i),1);
            }
        }
        for(int i=0;i<t.length();i++){
            if(string2.containsKey(t.charAt(i))){
                string2.put(t.charAt(i),string2.get(t.charAt(i))+1);

            }else{
                string2.put(t.charAt(i),1);
            }
        }


        for(Map.Entry<Character,Integer> entry: string1.entrySet()){
            if((!(string2.containsKey(entry.getKey()))) || ((int)string1.get(entry.getKey()) !=  (int)string2.get(entry.getKey()))){
                return false;
            }


        }
        return true;

    }
}